column3:
&quot;I think a lot about the many ways BLACK people can learn to fly/transcend. This is a musical, movement, spiritual + intellectual exercise for me. Sometimes when I’m practicing I record myself and share the videos online. I have developed an artistic practice to return daily to this exercise. I love my radical, black, queer, gender non-conforming existence. The world doesn't. I organize. I protest. I teach. I love. I listen. I create.&quot; 
- NIC KAY in the #OpenTVCommunity #weareopentv #bronxcunttour #lilBLK
http://www.weareopen.tv/open-tv-community//viewpoints-by-nic-kay
